import React from "react";

import Movie from "./Movie";
import classes from "./Movies.module.css";
import { TableSimple } from 'react-pagination-table';

const Movies = ({ list }) => {
  let cards = <h3>Loading...</h3>;

  if (list) {
    //cards = list.map((m, i) => <Movie key={i} item={m} />);
	  const Header = ["DESCRIPTION", "LIST_PRICE", "IN_STOCK" ];
	  
	  cards = ({Header, m}) =>
	      <div>
	          <TableSimple
	              title="TableSimple"
	              subTitle="Sub Title"
	              data={ data }
	              headers={ Header }
	              //Tell the component what order you wanna render.
	              columns="DESCRIPTION.LIST_PRICE.IN_STOCK"
	              arrayOption={ [["size", 'all', ', ']] }
	          />
	      </div>  
  }

  return (
    <div className={classes.Container}>
      <div className={classes.ContainerInner}>{cards}</div>
    </div>
  );
};

export default Movies;
